import React, { useState } from 'react';
//import './register.scss';

function Register() {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');
  const [confirmPassword, setConfirmPassword] = useState('');

  const handleRegister = (event: { preventDefault: () => void; }) => {
    event.preventDefault();
    if (password !== confirmPassword) {
      console.log('Passwords do not match.');
      return;
    }
    // Here you should add the logic to handle registration
    console.log('Username:', username);
    console.log('Password:', password);
  };

  return (
    <div className="register-container">
      <form onSubmit={handleRegister}>
        <div className="register-title">Registrati</div>
        <div className="input-group">
          <input
            type="text"
            className="input-field"
            placeholder="Email*"
            value={username}
            onChange={(e) => setUsername(e.target.value)}
          />
        </div>
        <div className="input-group">
          <input
            type="password"
            className="input-field"
            placeholder="Password*"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
          />
        </div>
        <div className="input-group">
          <input
            type="password"
            className="input-field"
            placeholder="Conferma Password*"
            value={confirmPassword}
            onChange={(e) => setConfirmPassword(e.target.value)}
          />
        </div>
        <button type="submit" className="register-button">REGISTRATI</button>
      </form>
    </div>
  );
}

export default Register;
